import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { Layout, Menu } from 'antd';
import { DashboardOutlined, UserOutlined, TeamOutlined, SettingOutlined } from '@ant-design/icons';
import Dashboard from './components/Dashboard';
import MemberJourney from './pages/MemberJourney';
import TeamAnalytics from './pages/TeamAnalytics';
import './App.css';

const { Header, Content, Sider } = Layout;

function App() {
  const [collapsed, setCollapsed] = React.useState(false);

  const menuItems = [
    {
      key: '1',
      icon: <DashboardOutlined />,
      label: 'Dashboard',
      path: '/'
    },
    {
      key: '2',
      icon: <UserOutlined />,
      label: 'Member Journey',
      path: '/member/rohan-patel'
    },
    {
      key: '3',
      icon: <TeamOutlined />,
      label: 'Team Analytics',
      path: '/team'
    }
  ];

  return (
    <Router>
      <Layout style={{ minHeight: '100vh' }}>
        <Sider collapsible collapsed={collapsed} onCollapse={setCollapsed}>
          <div className="logo" style={{ height: 32, margin: 16, background: 'rgba(255,255,255,.2)' }} />
          <Menu theme="dark" defaultSelectedKeys={['1']} mode="inline">
            {menuItems.map(item => (
              <Menu.Item key={item.key} icon={item.icon}>
                <a href={item.path}>{item.label}</a>
              </Menu.Item>
            ))}
          </Menu>
        </Sider>
        <Layout className="site-layout">
          <Header className="site-layout-background" style={{ padding: '0 24px', background: '#fff' }}>
            <h1 style={{ margin: 0, float: 'left' }}>Elyx Health Dashboard</h1>
            <div style={{ float: 'right' }}>
              <span>Member: Rohan Patel | Status: Active</span>
            </div>
          </Header>
          <Content style={{ margin: '24px 16px', padding: 24, background: '#fff', minHeight: 280 }}>
            <Routes>
              <Route path="/" element={<Dashboard />} />
              <Route path="/member/:memberId" element={<MemberJourney />} />
              <Route path="/team" element={<TeamAnalytics />} />
            </Routes>
          </Content>
        </Layout>
      </Layout>
    </Router>
  );
}

export default App;
